import React from "react";
const Home = () => {
    return(
        <form className="my-2 sm:w-full md:w-2/3 mx-auto flex px-2 text-2xl">
            <input type="text" className="rounded-1 border border-gray-500 flex-grow px-4 py-2" autoFocus={true} placeholder="Rechercher" />
            <button type="submit" className="bg-blue-700 rounded-r text-white px-4 py-2">Rechercher</button>
        </form>
    );

}

export default Home;
